import React, { useEffect, useState } from "react";
import api from "../../api";
import SidebarMenu from "../../components/SidebarMenu";

function DocumentManagementAdmin() {
  const [list, setList] = useState([]);
  const [title, setTitle] = useState("");
  const [file, setFile] = useState(null);

  const load = async () => {
    const res = await api.get("/admin/documents");
    setList(res.data);
  };

  useEffect(() => { load(); }, []);

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!file) {
      alert("Vui l√≤ng ch·ªçn file");
      return;
    }
    const formData = new FormData();
    formData.append("title", title);
    formData.append("file", file);

    try {
      await api.post("/admin/documents", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      alert("‚úÖ Upload th√†nh c√¥ng");
      setTitle("");
      setFile(null);
      load();
    } catch (err) {
      alert("‚ùå L·ªói upload");
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm("X√≥a t√†i li·ªáu n√†y?")) return;
    try {
      await api.delete(`/admin/documents/${id}`);
      alert("üóëÔ∏è ƒê√£ x√≥a");
      load();
    } catch (err) {
      alert("‚ùå L·ªói x√≥a");
    }
  };

  return (
    <div className="container mt-3">
      <div className="row">
        <div className="col-3"><SidebarMenu role="admin" /></div>
        <div className="col-9">
          <h3>üìÇ Qu·∫£n l√Ω t√†i li·ªáu</h3>

          <form onSubmit={handleUpload} className="mb-3">
            <input
              type="text"
              placeholder="T√™n t√†i li·ªáu"
              className="form-control mb-2"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              required
            />
            <input
              type="file"
              className="form-control mb-2"
              onChange={(e) => setFile(e.target.files[0])}
              required
            />
            <button className="btn btn-primary">Upload</button>
          </form>

          <table className="table table-bordered">
            <thead>
              <tr>
                <th>T√™n</th>
                <th>Ng∆∞·ªùi upload</th>
                <th>File</th>
                <th>H√†nh ƒë·ªông</th>
              </tr>
            </thead>
            <tbody>
              {list.map(doc => (
                <tr key={doc._id}>
                  <td>{doc.title}</td>
                  <td>{doc.uploadedBy?.username}</td>
                  <td>
                    <a href={`http://localhost:5000/${doc.filePath}`} target="_blank" rel="noreferrer">
                      Xem file
                    </a>
                  </td>
                  <td>
                    <button className="btn btn-danger btn-sm" onClick={() => handleDelete(doc._id)}>
                      X√≥a
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

        </div>
      </div>
    </div>
  );
}

export default DocumentManagementAdmin;
